import React, { Component } from 'react';
import Head from '../components/Head';
import axios from 'axios';

export default class Classes extends Component {


	constructor(props) {
		super(props);
		this.state = {
			students: [],
			changeStart: '',
			changeEnd: ''
		}
		axios.get(`/classes`)
			.then(res => {
				this.setState({ students: res.data });
			}).catch(error => {
				console.log(error);
			});

		this.handleClick = this.handleClick.bind(this);
		this.handleBlur = this.handleBlur.bind(this);
		this.handleOnMouseDown = this.handleOnMouseDown.bind(this);


	}

	handleClick(event) {
		// console.log(event.target.innerText);
		this.setState({ changeStart: event.target.innerText });

	}

	handleBlur(event) {
		// console.log(event.target.innerText);
		this.setState({ changeEnd: event.target.innerText });

		console.log('start', this.state.changeStart.valueOf());
		console.log('end', this.state.changeEnd.valueOf());
		console.log(this.state.changeStart.valueOf() == this.state.changeEnd.valueOf());

		// if(this.state.changeStart.valueOf()===this.state.changeEnd.valueOf())
		// console.log('111');


	}

	handleOnMouseDown(event){
		// console.log(event.target.innerText);

		// console.log(event.target.innerHTML);
		// this.setState({ changeEnd: event.target.innerHTML });

		// event.preventDefault();
	}

	render() {
		return (
			<div>
				<Head />
				<div id="body">
					<table>
						<thead>
							<tr>
								<td>name</td>
								<td>password</td>
								<td>class</td>
							</tr>
						</thead>
						<tbody>
							{this.state.students.map((stud)=><tr  key={stud.id}>
								<td><span contentEditable="true"  suppressContentEditableWarning={true} onClick={this.handleClick} onMouseDown={this.handleOnMouseDown} onBlur={this.handleBlur}>{stud.name}</span></td>
								<td><span contentEditable="true" suppressContentEditableWarning={true} onClick={this.handleClick} onMouseDown={this.handleOnMouseDown} onBlur={this.handleBlur}>{stud.password}</span></td>
								<td><span contentEditable="true" suppressContentEditableWarning={true} onClick={this.handleClick} onMouseDown={this.handleOnMouseDown} onBlur={this.handleBlur}>{stud.class}</span></td>
							</tr>)}
							</tbody>
					</table>
				</div>
			</div>
		);
	}
}
